 me_greek_1_black_sea.14.desc: "Nasza ostatnia ekspansja na nowe obszary Pontu Euksyńskiego znacznie zwiększyła naszą zdolność do kontrolowania północnych szlaków handlowych, tak jak [gm_family_head_1.GetPraenomen] na to liczył[Select_CString( gm_family_head_1.IsFemale, 'a', '' )].\n\n"
 me_greek_1_black_sea.14.desc_1: "Stare kolonie na wybrzeżu bityńskim będą służyć jako ważne twierdze wpływów hellenistycznych na południowych wybrzeżach."
 me_greek_1_black_sea.14.desc_2: "Stare kolonie w Chersonezie Taurydzkim należą do najbogatszych w całym regionie i z pewnością przyniosą nam wielkie bogactwo."
 me_greek_1_black_sea.14.desc_3: "Stare kolonie na wybrzeżach getyjskich ponownie staną się znaczącymi ośrodkami handlu i cywilizacji."
 me_greek_1_black_sea.14.desc_4: "Niewykorzystane bogactwo Kolchidy wreszcie po raz kolejny zostanie otwarte dla helleńskiej eksploatacji; te stare porty narodzą się na nowo."
 me_greek_1_black_sea.14.a: "Doskonale."
